INSERT INTO `admin_operation_log` VALUES ('1562', '1', 'admin/posts/4', 'PUT', '127.0.0.1', '{\"user_id\":\"1\",\"title\":\"nginx\\u57df\\u540d\\u89e3\\u6790\",\"abstract\":\"nginx\\u57df\\u540d\\u89e3\\u6790\",\"category_id\":\"5\",\"tags\":[\"3\",\"9\",null],\"content\":\"**\\u4f2a\\u9759\\u6001\\uff08\\u53bb\\u6389index.php\\uff09:**\\r\\n```bash\\r\\n#\\u5728\\u914d\\u7f6e\\u6587\\u4ef6\\u76f8\\u5e94\\u57df\\u540d\\u6dfb\\u52a0\\uff1a\\r\\nif (!-e $request_filename) {\\r\\n      rewrite ^(.*)$ \\/index.php$1 last;\\r\\n }\\r\\n```\\r\\n**\\u7ed1\\u5b9a\\u57df\\u540d\\uff1a\\uff08nginx\\/conf\\/vhosts.conf)**\\r\\n```bash\\r\\nserver{\\r\\n    listen  80;\\r\\n    server_name  shengle.me;\\r\\n    root  \\\"D:\\/phpStudy\\/WWW\\/shengle\\\";\\r\\n    #\\u4f2a\\u9759\\u6001\\r\\n    if (!-e $request_filename) {\\r\\n        #\\u5730\\u5740\\u4f5c\\u4e3a\\u5c06\\u53c2\\u6570rewrite\\u5230index.php\\u4e0a\\u3002\\/\\u52a0\\u4e0d\\u52a0index.php\\u90fd\\u53ef\\u4ee5\\u8bbf\\u95ee\\r\\nrewrite ^\\/index.php(.*)$ \\/index.php?s=$1 last;\\r\\n        rewrite ^(.*)$ \\/index.php?s=$1 last;\\r\\n    }\\r\\n    location \\/ {\\r\\n        index  index.php;\\r\\n        autoindex  off;\\r\\n    }\\r\\n    error_page   500 502 503 504  \\/50x.html;\\r\\n    location = \\/50x.html {\\r\\n        root   html;\\r\\n    }\\r\\n    location ~ \\\\.php(.*)$  {\\r\\n        fastcgi_pass   127.0.0.1:9000;\\r\\n        fastcgi_index  index.php;\\r\\n        fastcgi_split_path_info  ^((?U).+\\\\.php)(\\/?.+)$;\\r\\n        fastcgi_param  SCRIPT_FILENAME  $document_root$fastcgi_script_name;\\r\\n        fastcgi_param  PATH_INFO  $fastcgi_path_info;\\r\\n        fastcgi_param  PATH_TRANSLATED  $document_root$fastcgi_path_info;\\r\\n        include        fastcgi_params;\\r\\n    }\\r\\n}\\r\\n```\",\"is_top\":\"off\",\"is_recommend\":\"on\",\"_token\":\"DmJkl1h45QnuKAkcu96sDMBUkyhzLC3IhT9Ssn2D\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/blog-admin.test\\/admin\\/posts\",\"_ifraem_