INSERT INTO `posts` VALUES ('1', '1', 'composer整理', 'Composer 是 PHP5.3以上 的一个依赖管理工具。 包依赖管理意思就是：一个项目中引入某个包，而这个包又需要引入其他一些包', '1', 'images/phpcomposer.png', '# 简介\r\n\r\nComposer 是 PHP5.3以上 的一个依赖管理工具。 包依赖管理意思就是：一个项目中引入某个包，而这个包又需要引入其他一些包；\r\n\r\n# 安装\r\nwindows安装:\r\n\r\n	使用windows installer 辅助安装器(必须先安装php)\r\n	https://getcomposer.org/Composer-Setup.exe\r\n\r\nlinux安装：\r\n\r\n	curl -sS https://getcomposer.org/installer | php -- --install-dir=/usr/local/bin --filename=composer\r\n\r\n中国全量镜像 系统全局配置\r\n\r\n	composer config -g repo.packagist composer https://packagist.phpcomposer.com\r\n\r\n附：\r\n\r\n	composer官网 https://getcomposer.org/\r\n	composer中文网 http://www.phpcomposer.com/\r\n\r\n# 更新\r\n	composer self-update\r\n# 重新加载\r\n	composer install \r\n	composer dump-autoload -o\r\n# 忽略版本\r\n	composer install --ignore-platform-reqs\r\n	composer update --ignore-platform-reqs\r\n# 添加、卸载包\r\n	修改composer.json\r\n	执行composer update\r\n	\r\n附：\r\n\r\n	windows7下报错：  缺少ssl证书\r\n	打开php.ini 添加 extension=php_openssl.dll', '0', '1', '52', '2019-09-02 15:40:06', '2019-09-05 13:54:03', null);
INSERT INTO `posts` VALUES ('2', '1', 'laravel-admin  批量操作js报错', '批量操作js报错 selectedRows is not defined', '1', 'images/f5c95b73142d5f5e9128c659c79b46f4.png', '批量操作js报错 selectedRows is not defined\r\n```javascript\r\nUncaught ReferenceError: selectedRows is not defined\r\n    at HTMLAnchorElement.eval (eval at globalEval (jQuery-2.1.4.min.js:2), <anonymous>:162:18)\r\n    at HTMLAnchorElement.dispatch (jQuery-2.1.4.min.js:3)\r\n    at HTMLAnchorElement.r.handle (jQuery-2.1.4.min.js:3)\r\n```\r\n\r\n同样问题发生在demo.laraval-admin.org网站内\r\n\r\n![](https://user-images.githubusercontent.com/18704595/59487856-beac9080-8e32-11e9-9572-8645854553a6.png)\r\n\r\n目前通过替换 selectedRows 为 $.admin.grid.selected() 可以解决。', '0', '0', '4', '2019-09-03 16:05:42', '2019-09-06 12:09:43', null);
INSERT INTO `posts` VALUES ('3', '1', 'zsh以及oh-my-zsh的安装和配置', 'zsh是shell语言类型，兼容bash，提供强大的命令行功能，比如tab补全，自动纠错功能等，缺点就是配置太麻烦。oh my zsh 是基于 zsh 的功能做了一个扩展,方便的插件管理、主题自定义,以及漂亮的自动完成效果。', '2', 'images/b691b3fa0ffb6d6c90761a98d3afab1b_1200x500.jpg', '# 安装zsh(ubuntu)\r\n直接执行命令\r\n\r\n	sudo apt install zsh\r\n\r\n修改默认使用zsh作为shell\r\n\r\n	chsh -s /bin/zsh\r\n重启终端即可更换\r\n\r\n# 使用oh-my-zsh美化zsh\r\n## 安装oh-my-zsh\r\n	sh -c \"$(wget https://raw.githubusercontent.com/robbyrussell/oh-my-zsh/master/tools/install.sh -O -)\"\r\n默认主题robbyrussell\r\n## 修改主题\r\n所有的主题以及效果图都在 [Github](https://github.com/robbyrussell/oh-my-zsh/wiki/Themes \"Github\")\r\n执行以下命令\r\n\r\n	vim ~/.zshrc\r\n找到\r\n\r\n	ZSH_THEME=\"robbyrussell\"\r\n改为自己想要的主题即可，推荐一个主题 `agnoster`\r\n## 插件\r\n**代码高亮** `zsh-syntax-highlighting`\r\n\r\n	git clone https://github.com/zsh-users/zsh-syntax-highlighting.git $ZSH_CUSTOM/plugins/zsh-syntax-highlighting\r\n\r\n**自动提示** `zsh-autosuggestion`\r\n\r\n	git clone git://github.com/zsh-users/zsh-autosuggestions $ZSH_CUSTOM/plugins/zsh-autosuggestions\r\n\r\n在`.zshrc`下修改`plugins`添加插件即可\r\n\r\n	plugins=(git zsh-autosuggestions zsh-syntax-highlighting)\r\n\r\n# 常见问题\r\n## 目录权限问题\r\n安装`oh-my-zsh`插件后，重启可能会出现以下报错\r\n```bash\r\n[oh-my-zsh] Insecure completion-dependent directories detected:\r\ndrwxrwxrwx 1 ***** ***** 512 Oct 25 13:51 /home/*****/.oh-my-zsh/custom/plugins\r\ndrwxrwxrwx 1 ***** ***** 512 Oct 25 13:49 /home/*****/.oh-my-zsh/custom/plugins/zsh-syntax-highlighting\r\n\r\n[oh-my-zsh] For safety, we will not load completions from these directories until\r\n[oh-my-zsh] you fix their permissions and ownership and restart zsh.\r\n[oh-my-zsh] See the above list for directories with group or other writability.\r\n\r\n[oh-my-zsh] To fix your permissions you can do so by disabling\r\n[oh-my-zsh] the write permission of \"group\" and \"others\" and making sure that the\r\n[oh-my-zsh] owner of these directories is either root or your current user.\r\n[oh-my-zsh] The following command may help:\r\n[oh-my-zsh]     compaudit | xargs chmod g-w,o-w\r\n\r\n[oh-my-zsh] If the above didn\'t help or you want to skip the verification of\r\n[oh-my-zsh] insecure directories you can set the variable ZSH_DISABLE_COMPFIX to\r\n[oh-my-zsh] \"true\" before oh-my-zsh is sourced in your zshrc file.\r\n```\r\n添加一下权限即可\r\n```bash\r\nchmod 755 /home/*****/.oh-my-zsh/custom/plugins\r\nchmod 755 /home/*****/.oh-my-zsh/custom/plugins/zsh-syntax-highlighting\r\n```', '1', '1', '126', '2019-09-04 11:32:59', '2019-09-06 12:21:56', null);
INSERT INTO `posts` VALUES ('4', '1', 'nginx域名解析', 'nginx域名解析', '5', 'images/nginx.jpg', '**伪静态（去掉index.php）:**\r\n```bash\r\n#在配置文件相应域名添加：\r\nif (!-e $request_filename) {\r\n      rewrite ^(.*)$ /index.php$1 last;\r\n }\r\n```\r\n**绑定域名：（nginx/conf/vhosts.conf)**\r\n```bash\r\nserver{\r\n    listen  80;\r\n    server_name  shengle.me;\r\n    root  \"D:/phpStudy/WWW/shengle\";\r\n    #伪静态\r\n    if (!-e $request_filename) {\r\n        #地址作为将参数rewrite到index.php上。/加不加index.php都可以访问\r\nrewrite ^/index.php(.*)$ /index.php?s=$1 last;\r\n        rewrite ^(.*)$ /index.php?s=$1 last;\r\n    }\r\n    location / {\r\n        index  index.php;\r\n        autoindex  off;\r\n    }\r\n    error_page   500 502 503 504  /50x.html;\r\n    location = /50x.html {\r\n        root   html;\r\n    }\r\n    location ~ \\.php(.*)$  {\r\n        fastcgi_pass   127.0.0.1:9000;\r\n        fastcgi_index  index.php;\r\n        fastcgi_split_path_info  ^((?U).+\\.php)(/?.+)$;\r\n        fastcgi_param  SCRIPT_FILENAME  $document_root$fastcgi_script_name;\r\n        fastcgi_param  PATH_INFO  $fastcgi_path_info;\r\n        fastcgi_param  PATH_TRANSLATED  $document_root$fastcgi_path_info;\r\n        include        fastcgi_params;\r\n    }\r\n}\r\n```', '0', '0', '35', '2019-09-04 14:12:38', '2019-09-06 12:09:45', null);
INSERT INTO `posts` VALUES ('5', '1', '记一次nginx服务器502', '记一次nginx服务器502', '5', 'images/TIM截图20190905111155.png', '早上起来启动WSL，访问项目出现`502 Bad Gateway`\r\n查看`nginx`日志文件`error.log`\r\n发现提示错误\r\n\r\n    2019/09/05 11:06:33 [error] 996#996: *40 upstream prematurely closed connection while reading response header from upstream, client: 127.0.0.1, server: blog-admin.test, request: \"GET / HTTP/1.1\", upstream: \"fastcgi://unix:/run/php/php7.3-fpm.sock:\", host: \"blog-admin.test\"\r\n\r\n只需修改`php`路径中的`www.conf`文件中`request_terminate_timeou`这个参数，只需将前面的`；`去掉，设置为：\r\n\r\n	request_terminate_timeout=0\r\n\r\n然后保存重启php-fpm;', '0', '0', '65', '2019-09-05 11:22:54', '2019-09-06 12:01:04', null);
